import { React } from "react";
import { Route, Routes } from "./Router";

import "./App.css";

import Form from "./pages/Form";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Form />} />
      </Routes>
    </div>
  );
}

export default App;
